CHAPITRE  95 
JOUETS, JEUX, ARTICLES POUR DIVERTISSEMENTS OU POUR SPORTS;  
LEURS  PARTIES  ET ACCESSOIRES  
Notes.  
1.- Le présent  Chapitre ne  comprend  pas :
a)les bougies  (n° 34.06)  ;
b)les articles  de pyrotechnie  pour le divertissement  du n° 36.04 ;
c)les fils, monofilaments, cordonnets, guts et similaires pour la pêche, même coupés de longueur,
mais  non montés  en ligne,  du Chapitre  39, du n° 42.06  ou de  la Section  XI ;
d)les sacs pour articles  de sport  et autres  contenants  des n°s 42.02,  43.03  ou 43.04  ;
e)les travestis en matières textiles, des Chapitres 61 ou 62; les vêtements de sport et vêtements
spéciaux en matières textiles, des Chapitres 61 ou 62, même incorpora nt à titre accessoire des
éléments de protection tels que des plaques de protection  ou un rembourrage dans les parties
correspondant aux coudes, aux genoux ou à l’aine (les tenues d’escrimeurs ou les maillots de
gardiens  de but de football,  par exemple);
f)les drapeaux et les cordes à drapeaux en matières textiles, ainsi que les voiles pour embarcations,
planches  à voile ou chars  à voile,  du Chapitre  63 ;
g)les chaussures (à l'exception de celles auxquelles sont fixés des patins à glace ou à roulettes) du
Chap itre 64 et les coiffures  spéciales  pour la pratique  des sports  du Chapitre  65 ;
h)les cannes, les cravaches, les fouets et les articles similaires (n° 66.02), ainsi que leurs parties (n°
